import React from "react";
import Card from "../UI/Card";
import ExpenseForm from "./ExpenseForm";
import "./NewExpense.css";

const NewExpense = () => {
	return (
		<Card className="expense-item">
			<div className="new-expense">
				<ExpenseForm />
			</div>
		</Card>
	);
};

export default NewExpense;
